import React from "react";
import styled from "@emotion/styled";
import imagen from './cryptomonedas.png';

// estilos
const Contenedor = styled.div`
  max-width: 900px
  margin: 0 auto;
    @media (nim-width:992px){
      display:grid;
      grid-template-columns: repeat(2,1fr);
      column-gap:3rem
    }`
  ;

const Imagen = styled.img`
  max-width: 100%;
  margin-top:5rem;
`;


function App() {
  return (
    <Contenedor>
      <div>
        <Imagen
          src={imagen}
          alt="Imagen crypto">
        </Imagen>
      </div>
      <div>

      </div>
    </Contenedor>
  );
}

export default App;
